VALUES ('8480000197269', 'Salmón ahumado', 'Modo de empleo: l. Extender una copo de este preporodo en un recipiente del mismo tomofio que el solmén, poner encimo el lomo desolmôn (sin espinos ni escomos) y (Ubrirlo por completo con el preporodo. A moyor grosor del lomo de solmén, moyor grosor del preporodo poro ohumor. 2.Envolver el recipiente con film de pldstico e introducirlo en el frigorifico durante 24 horos. 3. Socor el salmén y desechor el preporodo, lovor el solmén con agua frio y secarlo con cuidodo. 4. Envolver de nuevo el salmén en papelfilm Y guardarlo en el frigorifia otros 24 horos para que repose. Yo puedes cortar y servir o tu gusto, Un delicioso salmén con aUténtico sabor ahumado. Conservar en frigorffico mdximo 2-3 dios. Con este preparado también puede salol Y ahumar trucha, palometa, bocalao, etc..', '', '6', '3', '14', '5', '8', '9', '5', '1.96850393700787', '', '0');

